import { Link } from "react-router-dom";
import ''

const Navbar = () => {
    return (
        <header>
            <nav>
               <Link to='/posts'>POSTS</Link> 
               <Link to='/profile'>PROFILE</Link> 
            </nav>
        </header>
    )
}

export default Navbar;
